int* dec2bin_no_ne_sovsem(int num, int& size) {
    int counter = 0;
    int temp = num;

    // ÐžÐ¿Ñ€ÐµÐ´ÐµÐ»ÑÐµÐ¼ Ñ€Ð°Ð·Ð¼ÐµÑ€ Ð¼Ð°ÑÑÐ¸Ð²Ð°
    while (temp > 0) {
        temp /= 2;
        counter++;
    }
    size = counter;

    // Ð’Ñ‹Ð´ÐµÐ»ÑÐµÐ¼ Ð¿Ð°Ð¼ÑÑ‚ÑŒ Ð¿Ð¾Ð´ Ð¼Ð°ÑÑÐ¸Ð²
    int* arr = new int[counter];

    // Ð—Ð°Ð¿Ð¾Ð»Ð½ÑÐµÐ¼ Ð¼Ð°ÑÑÐ¸Ð² Ð±Ð¸Ð½Ð°Ñ€Ð½Ñ‹Ð¼ Ð¿Ñ€ÐµÐ´ÑÑ‚Ð°Ð²Ð»ÐµÐ½Ð¸ÐµÐ¼ Ñ‡Ð¸ÑÐ»Ð°
    for (int i = counter - 1; i >= 0; i--) {
        arr[i] = num % 2;
        num /= 2;
    }

    return arr;
}
int bin2dec_no_ne_sovsem(int size, int* arr) {
    int dec = 0;
    int k = 1;
    // ÐŸÑ€ÐµÐ¾Ð±Ñ€Ð°Ð·Ð¾Ð²Ð°Ð½Ð¸Ðµ Ð±Ð¸Ð½Ð°Ñ€Ð½Ð¾Ð³Ð¾ Ñ‡Ð¸ÑÐ»Ð° Ð² Ð´ÐµÑÑÑ‚Ð¸Ñ‡Ð½Ð¾Ðµ
    for (int i = size-1; i >= 0; i--) {
        dec += arr[i] * k;
        k *= 2;
    }
   
    return dec;
}

