template <typename Type>
class SingleLinkedList {
    // Ð£Ð·ÐµÐ» ÑÐ¿Ð¸ÑÐºÐ°
    struct Node {
        Node() = default;
        Node(const Type& val, Node* next)
            : value(val)
            , next_node(next) {
        }
        Type value;
        Node* next_node = nullptr;
    };

public:

    SingleLinkedList() : head_(), size_(0) {};
    
    // Ð’Ð¾Ð·Ð²Ñ€Ð°Ñ‰Ð°ÐµÑ‚ ÐºÐ¾Ð»Ð¸Ñ‡ÐµÑÑ‚Ð²Ð¾ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð¾Ð² Ð² ÑÐ¿Ð¸ÑÐºÐµ Ð·Ð° Ð²Ñ€ÐµÐ¼Ñ O(1)
    [[nodiscard]] size_t GetSize() const noexcept {
        return size_;
    }

    // Ð¡Ð¾Ð¾Ð±Ñ‰Ð°ÐµÑ‚, Ð¿ÑƒÑÑ‚Ð¾Ð¹ Ð»Ð¸ ÑÐ¿Ð¸ÑÐ¾Ðº Ð·Ð° Ð²Ñ€ÐµÐ¼Ñ O(1)
    [[nodiscard]] bool IsEmpty() const noexcept {
        return (size_ == 0) ? true : false;
    }

private:
    // Ð¤Ð¸ÐºÑ‚Ð¸Ð²Ð½Ñ‹Ð¹ ÑƒÐ·ÐµÐ», Ð¸ÑÐ¿Ð¾Ð»ÑŒÐ·ÑƒÐµÑ‚ÑÑ Ð´Ð»Ñ Ð²ÑÑ‚Ð°Ð²ÐºÐ¸ "Ð¿ÐµÑ€ÐµÐ´ Ð¿ÐµÑ€Ð²Ñ‹Ð¼ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð¾Ð¼"
    Node head_;
    size_t size_;
};

void Test0() {
    using namespace std;
    {
        const SingleLinkedList<int> empty_int_list;
        assert(empty_int_list.GetSize() == 0u);
        assert(empty_int_list.IsEmpty());
    }

    {
        const SingleLinkedList<string> empty_string_list;
        assert(empty_string_list.GetSize() == 0u);
        assert(empty_string_list.IsEmpty());
    }
}

int main() {
    Test0();
}

